import React from "react";

function Note(props) {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={() => props.Delete(props.title)}>DELETE</button>
    </div>
  );
}

export default Note;
